import React from 'react'

const LogOutPage = () => {

    const logOut = () => {
        localStorage.removeItem('myToken').then(() => window.location.replace("/"))
    }

    return (
        <button 
            type="button" 
            className="btn btn-primary btn-block"
            onClick={
                logOut
            }
        >Log Out
        </button>

    )
}

export default LogOutPage
